import React from 'react';

const Footer = () => {
    return (
        <footer className="bg-gray-800 text-white py-4">
            <div className="container mx-auto text-center">
                <p>&copy; 2024 Lipostylee. All rights reserved.</p>
                <div className="mt-4">
                    <a href="https://twitter.com/yourprofile" target="_blank" rel="noopener noreferrer" className="mx-2 hover:text-blue-400">Twitter</a>
                    <a href="https://github.com/yourprofile" target="_blank" rel="noopener noreferrer" className="mx-2 hover:text-blue-400">GitHub</a>
                    <a href="https://linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer" className="mx-2 hover:text-blue-400">LinkedIn</a>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
